import React, {useEffect} from 'react'
import PropTypes from 'prop-types'

const Article = ({article}) => {
    useEffect(()=> {
        console.log(article)
    }, [])

    return (
    <div>title: {article.title}</div>
    )
}

Article.propTypes = {
    article: PropTypes.object.isRequired
}

export default Article
